    public function ScanDocument (Request $request) {
        $data = array();
        $class_id = $request->class_id;
        $subject_id = $request->subject_id;
        $book_id = $request->book_id;
        $temp_path = Config::get('constants.path.images');
        $class_path = $temp_path.$class_id."/";
        $subject_path = $temp_path.$class_id."/".$subject_id."/";
        $book_path = $temp_path.$class_id."/".$subject_id."/".$book_id."/";
        
        ## Dummy Scanned responce code for test without scanner.
        $res = $this->getImage(); //Curl::to($cbct_api."/multiple-scan")->get();
        //print_r($res); exit;
        
        
        $cbct_api = Config::get('constants.api.scanner');
        //echo $cbct_api."multi-scan";
        /*$res = Curl::to($cbct_api."multi-scan")->withData( array( 'duplex' => '1' ) )
        ->withOption('SSL_VERIFYHOST', false)
        ->withOption('TIMEOUT',0)
        ->get();*/
        
        if($res !== false){
            $response = json_decode($res);
            if($response->code == 200){
                if (!file_exists($temp_path)) {mkdir($temp_path, 0777, true);}

                if (!file_exists($class_path)) {mkdir($class_path, 0777, true);}

                if (!file_exists($subject_path)) {mkdir($subject_path, 0777, true);}

                if (!file_exists($book_path)) {mkdir($book_path, 0777, true);}

                foreach($response->images as $key => $images){
                    $folderPath = $book_path;
                    $image_base64 = base64_decode($images);
                    $file = $folderPath . ($key + 1) . '.png';
                    if (file_exists($file)) {
                        unlink($file);
                    }
                    file_put_contents($file, $image_base64);
                }

                $data['status'] = 200;
                $data['images'] = $response->images;
                $data['msg'] = "Success!! Book scanned successfully Done.";
                return json_encode($data);
            } else {
                $data['status'] = 204;
                $data['images'] = "";
                return json_encode($data);
            }
        } else {
            $data['status'] = 404;
            $data['images'] = "";
            $data['msg'] = "Network Error!! scanner is not responding OR please enter pages for scanning.";
            return json_encode($data);
        }
    }
    
