    public function UploadChapterPdf(Request $request){
        $data = array();
        extract($request->all());
        $temp_path_img = Config::get('constants.path.images').$class_id."/".$subject_id."/".$book_id."/";
        $temp_path = Config::get('constants.path.pdf');
        
        
        $class_path = $temp_path.$class_id."/";
        $subject_path = $class_path.$subject_id."/";
        $book_path = $subject_path.$book_id."/";
        $chapter_path = $book_path.$chapter_id."/";
        
        
        if (!file_exists($temp_path)) {mkdir($temp_path, 0777, true);}
            
        if (!file_exists($class_path)) {mkdir($class_path, 0777, true);}

        if (!file_exists($subject_path)) {mkdir($subject_path, 0777, true);}

        if (!file_exists($book_path)) {mkdir($book_path, 0777, true);}
        
        if (!file_exists($chapter_path)) {mkdir($chapter_path, 0777, true);}
        
        $pdf_path = $_SERVER['HTTP_HOST']."/book_pdf/".$class_id."/".$subject_id."/".$book_id."/".$chapter_id."/";
        
        $images_arr = array();
        for($i = $from_page; $i<= $to_page; $i++){
            $images_arr[] = $temp_path_img.$i.".png";
        }
        
        $pdf = new \Imagick($images_arr);
        $pdf->setImageFormat('pdf');
        $pdf_name = $chapter_id.date("YmdHis").'.pdf';
        $pdf->writeImages($chapter_path.$pdf_name, true);
        
        $pdf = base64_encode(file_get_contents($chapter_path.$pdf_name));
        
        $query_scan_details = Scan_details::select()
                ->where("standard_id", $class_id)
                ->where("subject_id", $subject_id)
                ->where("book_id", $book_id)
                ->where("chapter_id", $chapter_id);
        
        $rs_scan_details = $query_scan_details
                ->get();
        $pdf_number = $query_scan_details->count() + 1;
        
        $inserted_arr = array(
            "id" => md5(microtime() . rand()),
            "standard_id" => $class_id,
            "subject_id" => $subject_id,
            "book_id" => $book_id,
            "chapter_id" => $chapter_id,
            "pdf_name" => $pdf_name,
            "pdf_path" => $pdf_path, //$chapter_path,
            "pdf_number" => $pdf_number,
            "created_on" => date('Y-m-d H:i:s'),
            "created_by" => 1
        );
        
        $scan_details = Scan_details::create($inserted_arr);
        
        $data['Scan_details'] = $inserted_arr;
        $data['pdf'] = $pdf;
        
        #functionality to call to api upload ScanPDF on server
        #call to local pdf post data to upload
        //$posted_data = $this->getPostImage();
        //$posted_data = json_decode($data, true);

        $scanner_api = Config::get('constants.api.scanner_live');
        $res2 = Curl::to($scanner_api."api/scan")->withData( $data )->post();
        $response = json_decode($res2, true);
       
        if($response['code'] == 200){
           return json_encode($response);
        } else {
           $response = array();
           $response['code'] = 404;
           $response['data'] = "PDF is not uploaded.";
           
           return json_encode($response);
        }
    }
    
